const getYoutubeEmbedUrl = (url) => {
  const NUMBER = 11;
  const match = url.match(/^(?:https?:\/\/)?(?:www\.)?(?:youtube\.com|youtu\.be)\/(?:watch\?v=|embed\/)?(.+)$/);

  if (match && match[1].length === NUMBER) {
    return `https://www.youtube.com/embed/${match[1]}`;
  }

  return null;
};

export default getYoutubeEmbedUrl;
